script: |
  super -f text -I q7435.spq | sort > q7435.out

inputs:
  - name: q7435.spq
    data: |
      SELECT + ( + + 10 ) AS col1 FROM tab1 (FORMAT parquet) WHERE NOT - ( - col1 ) * + col1 BETWEEN - 65 AND - - ( - - 84 ) * - col0 + + - col2;
  - name: tab1

outputs:
  - name: q7435.out
    data: |
      10
      10
      10
